import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom';
import UnderStr from './underStrc';
import Section from './manager-sec';
import {section as sectionContent} from '../constants/section-content.js'

const Main = () => {
  return (
    <div className="section-cont">
      <Switch>
        <Route path={'/manager/add'}>
          <UnderStr />
        </Route>
        <Route path={'/manager'}>
          <Section path={sectionContent.path} title={'اطلاعات صندوق را وارد کنید'}/>
          <Section path={'/manager/add'} />
          <Section path={'/manager/add'} />
          <Section path={'/manager/add'} />
        </Route>
      </Switch>
    </div>
  );
}

export default Main;
